<!DOCTYPE html>
<html><head><link href="bundle/tilepieces.panel-history.bundle.css" rel="stylesheet" data-tilepieces-component="tilepieces/panel-history/bundle"></head>
<body>
<section id="panel-history">

  C11.2,7.8,11.8,7.8,12.2,8.2z"></path>
  <path style="fill:rgb(153, 153, 153);;" d="M10.8,8.2l-5.2,5.2c-0.4,0.4-0.4,1,0,1.4l0,0c0.4,0.4,1,0.4,1.4,0l5.2-5.2c0.4-0.4,0.4-1,0-1.4l0,0
  C11.8,7.8,11.2,7.8,10.8,8.2z"></path>
  </g>
        </svg>
        ${key.method}
      </span>
    </li>
  </ul>
</section>
<script src="bundle/tilepieces.panel-history.bundle.js" data-tilepieces-component="tilepieces/panel-history/bundle"></script></body></html>
